//SPDX-License-Identifier: CC0
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract HyperPoint is Context, ERC20, Ownable {
    event MintHP(address indexed recipient, uint256 amount);

    constructor() Ownable() ERC20("Hyper Point", "HPX") {
    }

    function decimals() public pure override returns (uint8) {
        return 0;
    }

    /// @param recipient address to send HP to
    /// @param amount number of HP to mint
    function ccMintTo(address recipient, uint256 amount) 
    external
    onlyOwner {
        _mint(recipient, amount);
        emit MintHP(recipient, amount);
    }
}

